import React from "react";
import "./App.css";
import { Button, Input } from "antd";
import "antd/dist/antd.css";

function App() {
  return (
    <div className="App">
      <Input placeholder="Basic usage" />
      <Button type="danger">danger</Button>
    </div>
  );
}

export default App;
